const Report = () => {
	return(
		<div className="reportExp">
			<h1>So you want to make a report, now do you?
			</h1>
			<p className="lineBreak"></p>
			<h4>It's the moment where you want to share to the world the amazing bowl of Ramen you just ate. But wait! How do I rate something that is as complex and varied as a bowl of Ramen? How can one bowl of Ramen compare to another when there are so many aspects to Ramen? (If you are unsure what those aspects are, click on READ UP ON RAMEN KNOWLEDGE).
			</h4> 
		</div>
	)
}

export default Report;
